import React from 'react';
import Nav from '../Nav';
import './home.css';
import image04 from '../../images/04.jpg';
import image05 from '../../images/08.png';
import image09 from '../../images/09.png';
import image10 from '../../images/09.png';
import image11 from '../../images/09.png';

function Home() {
  return (
    <div>
      <div className='nav03'>
        <Nav />
      </div>

      <div className='container03'>
        <img src={image04} alt='image'/>
        <img src={image05} alt='image'/>
      </div>
      <div className='badges03'>
        <hr></hr>
        <img src={image09} alt='image09'/>
      </div>
    </div>
  );
}

export default Home;
